Defendant Eric Y Alexander in court with attorney Vincent Paul Guimont.  Defendant Eric Y Alexander in custody.  Thomas L. Potter appeared for the State of Wisconsin.
-  AMENDED INFORMATION, FILED.
COUNT 1 and COUNT 2 AMENDED to Theft (Value Not Exceeding $2,500), contrary to 943.20(1)(a) and (3)(a), 939.51(3)(a), Wisconsin Stats, a CLASS A MISDEMEANOR.

AS TO AMENDED COUNTS 1 AND 2, Defendant changes plea to GUILTY. Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty. Court found that defendant freely, voluntarily and intelligently waived his rights. Plea questionnaire received and filed. Parties stipulate to the complaint as a factual basis to sustain defendant's plea. Court found defendant guilty as charged in the information and ordered a Judgment of Conviction be entered on the record. 

Sentencing proceeds.  Statements made by the state, defense counsel and defendant. Additional statements made by: Kenneth M. Jr.

AS TO COUNT 1
Defendant sentenced to serve 9 months at the HOUSE OF CORRECTION. Credit for 74 days time served. COURT STAYS sentence and placed defendant on PROBATION for a period of 18 MONTHS.

AS TO COUNT 2
Defendant sentenced to serve 9 months at the HOUSE OF CORRECTION, CONSECUTIVE TO COUNT 1. Credit for 0 days time served. COURT STAYS sentence and placed defendant on PROBATION for a period of 18 MONTHS, CONCURRENT TO COUNT 1.

.
CONDITIONS OF PROBATION: 
-AODA assessment and cooperate with any programs deemed necessary by the probation department;
-no possession/consumption/selling/distribution of illegal drugs/alcohol;
-random urine screens, if deemed appropriate;
-obtain/maintain fulltime employment/education/vocation;
-absolutely no contact with victim, Kenneth M;
-pay restitution in the amount of $8.00 to Kenneth M; failure to pay shall result in a civil judgment being entered;
-pay MANDATORY DNA surcharge;  failure to pay shall result in a civil judgment being entered (BOTH COUNTS);
-pay all court costs, fees, and surcharges; failure to pay shall result in a civil judgment being entered (BOTH COUNTS);
-pay all applicable fees of supervision; failure to pay shall result in a civil judgment being entered (BOTH COUNTS).
-
-  Court ORDERS defendant to pay $25.00, per month starting 08-26-2014.  All unpaid balances at the end of the probationary period will convert to a civil judgment.
-  Civil Judgment Warning given.
-  No Cash Bail Posted in this matter.  

Appeal rights given. Notice of Right to Seek Postconviction Relief received and filed. Copy given to defendant.
